import React, { useState, useEffect } from "react";
// import {
//  UsersCard
// } from "./pages/Users";

import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import TableContainer from '@material-ui/core/TableContainer';
import TablePagination from '@material-ui/core/TablePagination';
import Typography from '@material-ui/core/Typography';
import { Link } from "react-router-dom";
import { withStyles } from '@material-ui/core/styles';
import { Button, ThemeProvider } from '@material-ui/core';
import EditIcon from '@material-ui/icons/Edit';
import ClearIcon from '@material-ui/icons/Clear';
import axios from 'axios';
import Basketsadd from './Basketsadd';
import BasketsUpdate from './BasketsUpdate';
import { Dialog } from '@material-ui/core';
import { TextField } from '@material-ui/core';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogTitle from '@material-ui/core/DialogTitle';


const Baskets = () => {

  const [data, setData] = React.useState({
    error: '',
    data: [],
    temp: [],
    error: null,
    search: '',


  });
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };
  // const [q, setQ] = useState("");
  const [visible, setVisible] = React.useState(false);
  const [visible1, setVisible1] = React.useState(false);
  // const [basketdata, setBasketdata] = React.useState({
  //   name: "",
  //   PriceBeforeDis: "",
  //   PriceAfterDiscount: "",
  //   Discount: "",
  //   Description: "",
  //   restaurant_id: ""
  // });

  const showDialog = () => {
    setVisible(true);
  };
  // const showDialog1 = () => {
  //   setVisible(true);
  // };
  const handleCancel = () => {
    setVisible1(false);
  };
  // const handleEdit = () => {

  //   axios.put('https://api.foodealzapi.com/Invendus/4', basketdata)

  //     .then((basketdata) => {
  //       console.log(basketdata);
  //     })
  //     .catch(error => {
  //       console.log(error);
  //     });
  // }

  const CustomTableCell = withStyles(theme => ({
    body: {
      borderBottomColor: 'transparent',
      paddingTop: theme.spacing(1),
      paddingBottom: theme.spacing(1)
    }
  }))(TableCell);

  const getData = async () => {
    const url = 'https://api.foodealzapi.com/AllInvendus';
    let user;
    user = [];
    await fetch(url)
      .then(res => res.json())
      .then(res => {
        console.log(res)
        setData({
          ...data,
          data: res,
          

        });
      })
      .catch(error => {
        setData({
          ...data,
          error: 'Error Loading content',
        })
      })
  };

  useEffect(() => {
    getData()
  }, [])

  const searchFilterFunction = (text) => {
    const newData = data.temp.filter((item) => {
      const itemData = `${item.nom.toUpperCase()}`;
      const textData = text.toUpperCase();
      return itemData.indexOf(textData) > -1;
    });
    console.log(newData)
    setData({
      ...data,
      data: newData
    })
  };
  const Title1 = {
    fontSize: '20px',
    color: '#008037',
    fontWeight: 'bold',
    marginLeft: '20px',
    justifyContent: 'center'
  }

  const Search1 = {

    backgroundColor: 'white',
    marginLeft: '20px',
    marginTop: '20px',
    borderBottomWidth: 1,
    borderBottomColor: '#b4b4b4b4b4'
  }
  const item = {
    fontSize: '12px',
    flexDirection: 'row',
    marginLeft: '15px',
    fontWeight: 'bold'
  }
  const Field = {
    marginLeft: '20px',
    width: '500px',
    marginTop: '25px',
    padding: '15px',


  }
  const buttonstyle = {
    marginLeft: '20px',
    marginTop: '50px',
    backgroundColor: '#008037',
    width: '100px',
    borderRadius: '5px'
  }
  // const addBasket = () => {
  //   let items = localStorage.getItem('itemInvendu');

  //   console.log(items)
  //   axios.post('https://api.foodealzapi.com/Invendus/4', items).then((res) => {

  //     console.log(res.data)
  //   })
  //     .catch(error => {
  //       console.log(error)
  //     });
  //   // items.map((item) => {

  //   // })
  //   // sessioncStorage.setItem('items', JSON.stringify([]));

  //   setData({
  //     ...data,

  //   })
  //   // navigation.jumpTo('Mes Couffins')
  //   // navigation.goBack()
  // }
  //  



  const handleRemove = async (id) => {
    axios
      .delete(`https://api.foodealzapi.com/AllInvendus/${id}`)

      .then(res => {
        axios.get('https://api.foodealzapi.com/AllInvendus'),
          // res.header ('Access-Control-Allow-Origin','*'),

          // res.header("Access-Control-Allow-Headers", "Origin, X-Requested-With, Content-Type, Accept");
          console.log(res.json())
          setData({
            ...data,
            data: res,
            
          })


      })
      .catch((error) => {
        console.log(error);
      })
  }
  return (
    <div>
      <div style={Title1}>
        <h2>Baskets</h2>

      </div>
      <div>
        <div style={buttonstyle}>
          <Link to='/Basketsadd'>
            <Button variant="outline-success"  >add Item </Button>
          </Link>
        </div>
        <div style={Search1} >
          <input type="text" placeholder=" Search Here..."
            contentEditable={true}
            onChange={e => searchFilterFunction(e.target.value)} />
        </div>
        <div style={item}>
          <Paper >
            <TableContainer >
              <Table>
                <TableHead>
                  <TableRow>
                    <CustomTableCell>Id</CustomTableCell>
                    <CustomTableCell align="right">Name</CustomTableCell>
                    <CustomTableCell align="right">Image</CustomTableCell>
                    <CustomTableCell align="right">PriceBeforeDiscount</CustomTableCell>
                    <CustomTableCell align="right">PriceAfterDiscount</CustomTableCell>
                    <CustomTableCell align="right">Discount</CustomTableCell>
                    <CustomTableCell align="right">Discription</CustomTableCell>
                    <CustomTableCell align="right">createAt</CustomTableCell>
                    <CustomTableCell align="right">updatedAt</CustomTableCell>
                    <CustomTableCell align="right">restaurantId</CustomTableCell>



                  </TableRow>
                </TableHead>
                <TableBody>
                  {data.data.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map((item, id) => {
                    return (
                      <TableRow hover role="checkbox" tabIndex={-1} key={id}>
                        <CustomTableCell>

                          {item.id}
                        </CustomTableCell>
                        <CustomTableCell align="right">
                          {item.nom}
                        </CustomTableCell>
                        <CustomTableCell align="right">
                          {item.image}
                        </CustomTableCell>
                        <CustomTableCell align="right">
                          {item.PriceBeforeDiscount}
                        </CustomTableCell>
                        <CustomTableCell align="right">
                          {item.PriceAfterDiscoun}
                        </CustomTableCell>
                        <CustomTableCell align="right">
                          {item.discount}
                        </CustomTableCell>
                        <CustomTableCell align="right">
                          {item.description}
                        </CustomTableCell>
                        <CustomTableCell align="right">
                          {item.createdAt}
                        </CustomTableCell>
                        <CustomTableCell align="right">
                          {item.updatedAt}
                        </CustomTableCell>
                        <CustomTableCell align="right">
                          {item.restaurant_id}
                        </CustomTableCell>
                        <CustomTableCell align="right">
                          <Link to='/BasketsUpdate'>
                            <Button style={{ marginLeft: '20px', marginTop: '50px', backgroundColor: '#008037' }} variant="outline-success" >
                              <EditIcon />

                            </Button>
                          </Link>
                        </CustomTableCell>
                        <CustomTableCell align="right">
                          <Button style={{ marginLeft: '20px', marginTop: '50px', backgroundColor: '#008037' }} variant="outline-success" onClick={showDialog}>
                            <ClearIcon />
                          </Button>

                        </CustomTableCell>
                        <Dialog

                        >
                          <DialogTitle >Confirmation</DialogTitle>
                          <DialogContent>
                            <DialogContentText >
                              you are sure !! you want to delete this basket?
          </DialogContentText>
                          </DialogContent>
                          <DialogActions>
                            <Button onClick={handleCancel} color="primary">
                              cancel
          </Button>
                            <Button onClick={handleRemove(data.id)} color="primary" >
                              Agree
          </Button>
                          </DialogActions>
                        </Dialog>
                      </TableRow>
                    );
                  })}




                </TableBody>
              </Table>
            </TableContainer>
            <TablePagination
              rowsPerPageOptions={[10, 25, 100]}
              component="div"
              count={data.data.length}
              rowsPerPage={rowsPerPage}
              page={page}
              onChangePage={handleChangePage}
              onChangeRowsPerPage={handleChangeRowsPerPage}
            />
          </Paper>
        </div>
        <div>

        </div>

      </div>
    </div>
  )
}
export default Baskets;
